// Challenge 1 solution
const friends = [
  {
    name: "sam",
    score: 20,
    isMeet: false,
  },
  {
    name: "john",
    score: 100,
    isMeet: false,
  },
  {
    name: "Jim",
    score: 15,
    isMeet: false,
  },
  {
    name: "ali",
    score: 5,
    isMeet: false,
  },
];
export default function tobiesFriends(n, scores) {
  // place your solution here
  friends.sort((a, b) => parseFloat(a.score) - parseFloat(b.score));
  console.log(friends);
}
tobiesFriends(friends, 100);
